--
-- Name: search_results; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.search_results AS
 SELECT order_entries.order_id AS searchable_id,
    'Order'::text AS searchable_type,
    products.name AS search_term
   FROM (public.order_entries
     JOIN public.products ON ((products.id = order_entries.product_id)))
UNION
 SELECT order_entries.order_id AS searchable_id,
    'Order'::text AS searchable_type,
    (products.id)::text AS search_term
   FROM (public.order_entries
     JOIN public.products ON ((products.id = order_entries.product_id)))
UNION
 SELECT orders.id AS searchable_id,
    'Order'::text AS searchable_type,
    (orders.brand_id)::text AS search_term
   FROM public.orders
UNION
 SELECT orders.id AS searchable_id,
    'Order'::text AS searchable_type,
    brands.name AS search_term
   FROM (public.orders
     JOIN public.brands ON ((brands.id = orders.brand_id)))
UNION
 SELECT orders.id AS searchable_id,
    'Order'::text AS searchable_type,
    (order_users.regional)::text AS search_term
   FROM (public.orders
     JOIN public.order_users ON ((order_users.order_id = orders.id)))
  WHERE (order_users.regional IS NOT NULL)
UNION
 SELECT orders.id AS searchable_id,
    'Order'::text AS searchable_type,
    (order_users.comms)::text AS search_term
   FROM (public.orders
     JOIN public.order_users ON ((order_users.order_id = orders.id)))
  WHERE (order_users.comms IS NOT NULL)
UNION
